import React from 'react';
import styles from './Product.module.scss';

const Product = ({
    brand,
    src
}) => {
  return (
    <div className={styles.container}>
        {brand}
        <img src={src} />
        <button>View Package</button>
    </div>
  );
}

export default Product;
